import Button from '@mui/material/Button';

const CartDropDown = () => {
  return (
    <div className='cart-dropdown'>
      <div className='cart-dropdown-items'>
      ddddd
      </div>
      <Button
            sx={{
              marginTop: '30px',
              borderRadius: '0px',
              backgroundColor: 'rgba(224, 11, 203, 1)',
              '&:hover': {
                backgroundColor: 'black',
              }
            }}
            variant="contained" 
            size="large"
            type='submit'
          >
            Sign In
          </Button>
    </div>
  ) 
}

export default CartDropDown;
